import React, {useState} from 'react'

function SearchResults() {
    const [search, setSearch] = useState('');


    return(
        <>
            <form>
                <label>Search: 
                    <input 
                        type='text'
                        value={(e) => setSearch(e.target.value)}
                    />
                </label>
                <button type='submit'>
                    Find my jammms!
                </button>
            </form>
        </>

    )
}

export default SearchResults;
